import React from 'react';
import styles from './LeadsContainer.module.css';

const LeadsContainer = ({leadkeys, leads}) => {
    console.log(leads);
    let columns = <React.Fragment> 
                        <div style={{minWidth:"3rem"}} className={styles.column}>
                            <input type="checkbox"/>
                        </div> 
                        { leadkeys.map((key, index) => <div key={index} className={styles.column}>{key.label}</div>) } 
                    </React.Fragment>;
    let leadsRecords = <React.Fragment>
                            <div style={{minWidth:"3rem"}} className={styles.column}>
                                <input type="checkbox"/>
                            </div>
                           { leads.map(lead => <React.Fragment>
                            <div className={ styles.column }>
                                {lead.company|| "-"}
                            </div> 
                            <div className={ styles.column }>
                                { lead.first_name|| "-" }
                            </div> 
                            <div className={styles.column}>
                                { lead.last_name|| "-" }
                            </div>
                            <div className={styles.column}>
                                { lead.email|| "-" }
                            </div>
                            <div className={styles.column}>
                                { lead.website|| "-" }
                            </div>
                            </React.Fragment> ) 
                        }
                        </React.Fragment>

    return  <section className={styles.leadsContainer}>
                <section className={styles.leadsfilter}>
                    <p>Filter Leads by:</p>
                </section>
                <section className={styles.leadsrecords}>
                    <div className={styles["lead-columns"]}>
                        { columns }
                    </div>
                    <div style={{marginTop: "1px"}} className={styles["lead-columns"]}>
                        {leadsRecords}
                </div>
                </section>
            </section>
}

export default LeadsContainer
